import React from "react";
import { Link } from "react-router-dom";

const ToolBar = () => {
  return (
    <>
      <Link to="/">Home</Link>
      <Link to="/auth/login" style={{ float: "right" }}>
        Login
      </Link>

      <Link to="/auth/register" style={{ float: "right", marginRight: 10 }}>
        SignUp
      </Link>
    </>
  );
};

export default ToolBar;
